import React from 'react';
import Grid from '@material-ui/core/Grid';

const styles = {
  thumbnail:{
    maxWidth:300,
    maxHeight:300,
    width: 'auto',
    height: 'auto'
  }
};

const Thumbnails = ({
  projects,
  history
})  => (
  <Grid container spacing ={0} >
    {projects.map(function(project, index){
      return (          
        <Grid item xs={12} key={index}>
          <img src={project.thumbnail} alt={project.title} style={styles.thumbnail} />
        </Grid>
      )
    })}
  </Grid>
);

export default Thumbnails;
